import React from 'react';
import './App.css';
import {Board} from "./Board";

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <Board board={[["A", "B", "C"], ["w2", "w3", "D"], ["E", "l1", "l2"]]}/>
      </header>
    </div>
  );
}

export default App;
